import React from 'react';
import { calculateScore } from './Calculate';
import Main from './Main';

function Result({answer}) {
  // Main 컴포넌트에서 answer 상태를 전달하고 calculateScore 함수를 호출하여 점수를 계산
  const score = calculateScore(answer);

  return (
    <div>
      <h1>결과</h1>
      <div> 총 점수 : {score} </div>
    </div>
  );
}

export default Result;
